css:
.gutter[gutter-name="nuclide-perf"] {
  display: flex;
  width: 133px;
  font-family: system-ui;
  font-size: 13px;
  text-align: center;
  background: repeating-linear-gradient(-45deg, #2f333d, #2f333d, 5px, transparent 5px, transparent 10px);
}
.gutter-row {
  box-sizing: border-box;
  width: 133px;
  position: absolute;
  top: 0;
  bottom: 0;
  background: #282c34;
}
.gutter-content {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
  padding-right: 5px;
  padding-left: 5px;
  vertical-align: bottom;
}
.gutter-content:hover {
  color: #d7dae0;
  cursor: pointer;
  text-decoration: underline;
}
